components:
  schemas:
    AccountAchievement:
      type: object
      required: [ id, done ]
      x-ktx-identifiable:
        id: id
      properties:
        id:
          $ref: "#/components/schemas/AchievementId"
        bits:
          type: [ array, "null" ]
          description: Reference ids indicating progress of the achievement. Null if there is no progress indication.
          items:
            type: integer
        current:
          type: integer
          description: The current progress of the achievement.
        maximum:
          type: integer
          description: The amount of progress needed to complete the achievement.
        done:
          type: boolean
          description: Whether the achievement is complete.
        repeated:
          type: integer
          description: The number of times the achievement has been completed, if the achievement is repeatable.
        unlocked:
          type:
            - boolean
            - "null"
          description: Whether the achievement is unlocked. Null if the achievement does not support locking.
    
